import React from 'react';
import Configuration from './components/Configuration';
import UserManagement from './components/UserManagement';
import BusinessManagement from './components/BusinessManagement';
import TemplateManagement from './components/TemplateManagement';
import StageManagement from './components/StageManagement';
import SendMessage from './components/SendMessage';
import './App.css';
import Container from '@mui/material/Container';  // Import Container
import Typography from '@mui/material/Typography'; // Import Typography

function App() {
  return (
    <Container maxWidth="md"> {/* Wrap everything in a Container */}
      <Typography variant="h4" align="center" gutterBottom>ICMP Interface</Typography> {/* Add a title */}
      <div className="App">
        <Configuration />
        <UserManagement />
        <BusinessManagement />
        <TemplateManagement />
        <StageManagement />
        <SendMessage />
      </div>
    </Container>
  );
}

export default App;
